import React, { Component } from 'react';
import WebsiteLayout from '../../components/wrapper/mainSite';

export default class ReliefLine extends Component {
	render() {
		return (
			<WebsiteLayout>
				<div>ReliefLine</div>
			</WebsiteLayout>
		);
	}
}
